import React, {Fragment} from 'react';

const Home = () => {
  return (
    <Fragment>
      <h1>Portfolio</h1>
      <div className='wrapper'>
        <form id='stock-form' method='post' action>
          <input type='text' className='stock-control' placeholder='Ticker' />
          <input type='text' className='stock-control' placeholder='Qty' />
          <input type='submit' className='stock-control submit' value='Buy' />
        </form>
      </div>
    </Fragment>
  );
};

export default Home;
